import React from "react";

function Ul_li(prop,t){
    return (
        <li className="bg-dark text-white list-group-item">
        <input type="checkbox" id={t.text}></input>
        <label for={prop.ay}>{prop.ay}</label>
      </li>
        );
}

export default Ul_li;
